export default function colorHandler() {
  const colors = [
    {
      name: 'green',
      display: 'Grøn',
      css: 'bg-primary text-white'
    },
    {
      name: 'red',
      display: 'Rød',
      css: 'bg-red-500 text-white'
    },
    {
      name: 'yellow',
      display: 'Gul',
      css: 'bg-yellow-500 text-black'
    },
    {
      name: 'pink',
      display: 'Pink',
      css: 'bg-pink-500 text-white'
    },
    {
      name: 'black',
      display: 'Sort',
      css: 'bg-black text-white'
    },
    {
      name: 'orange',
      display: 'Orange',
      css: 'bg-orange-500 text-white'
    },
  ];

  const getTaskColors = (taskColor) => {
    const color = [];
    switch(taskColor) {
      case 'red':
        color['background'] = 'rgb(239 68 68)';
        color['border'] = 'rgb(220 38 38)';
        color['text'] = '#fff';
        break;
      case 'yellow':
        color['background'] = 'rgb(253 224 71)';
        color['border'] = 'rgb(250 204 21)';
        color['text'] = 'black';
        break;
      case 'pink':
        color['background'] = 'rgb(236 72 153)';
        color['border'] = 'rgb(219 39 119)';
        color['text'] = 'white';
        break;
      default:
        color['background'] = '#81cd74';
        color['border'] = '#6fba62';
        color['text'] = '#ffffff';
    }

    return color;
  };

  return {
    getTaskColors,
    colors
  }
}
